export const DataTable = () => {

    const { state } = useContext( PeopleContext );
    console.log(state); 

    return (
        <>
            {
                state.map( people => (
                    <DataTableScreen
                        key={ people.id }
                        { ...people }
                    />
                ))
            }
        </>
    )
}
